{"result":"*[aria-label]::after {
  content: "a-l: [" attr(aria-label) "]";
  padding: .4rem;
  background-color: #BEFF00;
  color: #000;
  border-radius: 4px;
  font-size: .8rem;
}
a[target="_blank"]{
    border: 1px dashed #4F7E2A;
    padding: 2px;
}
a[target="_blank"]::after {
  content: " ↦";
  font-weight: bold;
  padding: .4rem;
  background-color: #BEFF00;
  color: #000;
  border-radius: 4px;
  font-size: .8rem;
}
a[target="_blank"][aria-label]::after {
  content: "a-l: [" attr(aria-label) "] ↦";
  font-weight: bold;
  padding: .4rem;
  background-color: #BEFF00;
  color: #000;
  border-radius: 4px;
  font-size: .8rem;
}
a[href$=".pdf"]{
border: 1px dashed #533DC2;
padding: 2px;
}
a[href$=".pdf"]::after {
  content: "PDF";
  font-weight: bold;
  padding: .4rem;
  background-color: #BEFF00;
  color: #000;
  border-radius: 4px;
  font-size: .8rem;
}
a[href$=".pdf"][target="_blank"]::after {
  content: " PDF ↦";
  font-weight: bold;
  padding: .4rem;
  background-color: #BEFF00;
  color: #000;
  border-radius: 4px;
  font-size: .8rem;
}
a[href$=".pdf"][target="_blank"][aria-label]::after {
  content: "a-l: [" attr(aria-label) "] || PDF ↦";
  font-weight: bold;
  padding: .4rem;
  background-color: #BEFF00;
  color: #000;
  border-radius: 4px;
  font-size: .8rem;
}"}
